import React from 'react';
import Navbar from '../Home/Navbar';
import Footer from '../Home/Footer';

const Cart = () => {
    return (
        <>
            <Navbar />

            <div className='cart_main'>
                <table>
                    <tr>
                        <th>Product</th>
                        <th>Quantity</th>
                        <th>Subtotal</th>
                    </tr>
                    <tr>
                        <td>Product Name</td>
                        <td><input type='number' placeholder='1' /></td>
                        <td>Rs. 1299</td>
                    </tr>
                </table>
            </div>

            <Footer />
        </>
    )
}

export default Cart;
